import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Route, Switch} from 'react-router';
import {BrowserRouter} from 'react-router-dom';
import {composeWithDevTools} from "redux-devtools-extension";
import { createStore, applyMiddleware } from 'redux';
import thunk from 'redux-thunk';
import rootReducer from './reducers/rootReducer';
import {Provider} from 'react-redux';
import { LandingPageLayout } from './components/landingPage/layout';
import { WhiteTextField } from './assets/inputTypes/inputTypes'
import {makeStyles, createMuiTheme} from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import { ThemeProvider } from '@material-ui/styles';
import { green, purple } from '@material-ui/core/colors';


const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing(1),
  },
}));

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#fff',
    },
  },
});

let buttonDisabled = true;

const handleChange = () => {
  console.log('Chaning');
};

function App() {
  const classes = useStyles();

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className='inputs'>
          Welcome to the Science Spelling Training.<br/><br/>
          Please enter your name:
          <div className='name-input-container'>
            <WhiteTextField id="name-input" fullWidth label="Name" variant="outlined" onChange={handleChange}/>
          </div>
        </p>

        <ThemeProvider theme={theme}>
          <Button variant="contained" color="primary" size='large' disabled={buttonDisabled}>
            Continue
          </Button>
      </ThemeProvider>
      </header>
    </div>
  );
}

const store = createStore(rootReducer, composeWithDevTools(applyMiddleware(thunk)))

function Index() {
    return (
        <Provider store={store}>
            <BrowserRouter>
                <Switch>
                    <Route path={'/'} exact component={LandingPageLayout}></Route>
                </Switch>
            </BrowserRouter>
        </Provider>
    )
}

export default App;
